大豆をウィンナーソーセージ風に加工したもので、和、洋、中いずれにも料理の素材として自由に味 付けができます。 <br>大豆を主とし、卵白をつなぎに用いて生まれた植物性蛋白食品です。コレステロールは ゼロです。 菜食の方、のヘルシーな毎日の食卓作りに お役立てください。<br><table width="600" border="0" style="font-size:100%"><tr style="width:" align="center"><th width="576" style="background-color:#d2cac4; color:#fff; letter-spacing:1px; padding:10px">商品詳細</th></tr><tr><td><table width="594" border="0" cellpadding="7" cellspacing="1" bgcolor="#d2cac4" style="font-size:95%; line-height:130%; letter-spacing:110%"><tr bgcolor="#999999"><td width="110" height="25" bgcolor="#f4f0ec" align="center">商品番号</td><td width="453" bgcolor="#ffffff">km6104</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">原材料</td><td bgcolor="#ffffff">豆たん白(遺伝子組換えでない)、なたね油、卵白粉、植物たん白酵素分解物(小麦を含む)、砂糖(三温糖)、食塩(粗精塩)、香辛料、紅麹色素、レシチン、香料</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">内容量</td><td bgcolor="#ffffff">400g</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">賞味期限</td><td bgcolor="#ffffff">2年</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">広告文責</td><td bgcolor="#ffffff">有限会社自然館 0957-22-8770</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">販売元</td><td bgcolor="#ffffff">三育フーズ株式会社</td></tr></table></td></tr></table><style type=”text/css”>
