コラーゲンをはじめとする成分をギュッと詰め込みました。<br>年齢を重ねても、美しくハリのある女性に嬉しい美容ドリンクです安心なノンカフェイン<br><br>【ご使用上の注意】<br>・原材料が浮遊・沈殿したり、時間の経過により液色が変化したりすることがありますが、品質には問題ありません。よく振ってからお飲みください。<br>・ビンはわれものです。加温、冷凍はしないでください。<br>・開栓後は、お早めにお召し上がりください。<br>・原材料名をご参照の上、食品アレルギーのある方はお召し上がりにならないでください。また、体質に合わない場合は摂取を中止してください。<br>・小児の手の届かないところに保存してください。<br>・妊娠中の方、授乳中の方、乳幼児及び小児は摂取しないでください。<br>・過剰摂取はしないでください。（イソフラボンを含有する他の特定保健用食品等との併用には注意してください。1日の上限アグリコン換算30mg）大豆イソフラボン１本中20mg(アグリコン換算12.5mg）<br>・医療機関にかかっている方は医師に相談してください。<br>・食生活は、主食、主菜、副菜を基本に、食事のバランスを。<br>・キャップの切り口や突起部でケガをしないようにご注意ください。<table width="600" border="0" style="font-size:100%"><tr style="width:" align="center"><th width="576" style="background-color:#d2cac4; color:#fff; letter-spacing:1px; padding:10px">商品詳細</th></tr><tr><td><table width="594" border="0" cellpadding="7" cellspacing="1" bgcolor="#d2cac4" style="font-size:95%; line-height:130%; letter-spacing:110%"><tr bgcolor="#999999"><td width="110" height="25" bgcolor="#f4f0ec" align="center">商品番号</td><td width="453" bgcolor="#ffffff">km9284</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">原材料</td><td bgcolor="#ffffff">エリスリトール、ぶどう果汁（マスカット）、プラセンタエキス濃縮粉末（豚由来）、絹たんぱく加水分解物、デキストリン、大豆胚芽抽出物（イソフラボン含有）、カルシウムＨＭＢ、ローヤルゼリー、プロテオグリカン含有サケ鼻軟骨抽出物、エラスチンペプチド、ラクトビオン酸含有乳糖発酵物（乳糖を含む）、アマニ抽出物、高麗人参抽出物、ザクロ果汁粉末、レモンバームエキス、パイナップル果実抽出物（セラミド含有）、レッドプロポリス抽出エキス（米粉、レッドプロポリス抽出物）、月桃葉エキス／ビタミンＣ、香料、Ｌ－ヒドロキシプロリン、甘味料（アセスルファムＫ、スクラロース）、ヒアルロン酸、乳化剤（大豆由来）、増粘多糖類、酸味料、ヘマトコッカス藻色素、Ｖ．Ｂ2、Ｖ．Ｂ6、1、パントテン酸Ｃａ、ナイアシン、葉酸、Ｖ．Ｂ12</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">お召し上がり方</td><td bgcolor="#ffffff">1日1本を目安にお召し上がりください。冷やしてお飲みいただくと、より美味しくお召し上がりいただけます。</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">内容量</td><td bgcolor="#ffffff">1箱（50ml×10本セット）</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">賞味期限</td><td bgcolor="#ffffff">1年6ヵ月</td></tr><td height="25" bgcolor="#f4f0ec" align="center">栄養成分</td><td bgcolor="#ffffff">1本（50mL）あたりエネルギー：10kcal、たんぱく質：0.45g、脂質：0g、炭水化物：3.05g、食塩相当量：0.126g、ナイアシン：1mg、ビタミンB2：1.0mg、ビタミンB6：1.0mg、ビタミンC：1000mg<br>プラセンタエキス濃縮粉末：300mg（プラセンタ原料換算15000mg）、Ｌ－ヒドロキシプロリン：120mg、サケ鼻軟骨抽出物：25mg（プロテオグリカンとして5mg）、ＨＭＢ：24mg、ヒアルロン酸：25mg、ナノ化ヒアルロン酸：2.5mg、高分子ヒアルロン酸：2.5mg、大豆イソフラボン：20mg（アグリコン換算12.5mg）</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">区分</td><td bgcolor="#ffffff">日本製・健康食品</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">広告文責</td><td bgcolor="#ffffff">有限会社自然館0957-22-8770</td></tr><tr bgcolor="#999999"><td height="25" bgcolor="#f4f0ec" align="center">販売元</td><td bgcolor="#ffffff">株式会社協和</td></tr></table></td></tr></table><style type=”text/css”>
